import React from 'react'
import "./stylesheets/App.css"
import Home from "./Containers/Home";


class App extends React.Component {

    state = {
        current_page: ""
    }

    componentDidMount() {
        this.setState({
            current_page: <Home />
        })
    }

    render() {
        return (
            <div className="App">
                <h1>react</h1>
                <Iframe source={this.state.src} />
            </div>
        );
    }

}

export default App
